import { NavLink } from 'react-router-dom';
const MainPage=()=>{
    return (
        <>
          <div style={{backgroundImage:"url(Images)",width:"400px",margin:"auto",height:"100vh",display:"grid",alignItems:"center"}}>
        <h2 style={{textAlign:"center", textDecoration:"none",color:"black"}}><NavLink to="/Subject">Begin the Test</NavLink></h2>
        </div>
        </>
    )
}
export default MainPage;
